	(5, 8, 2, 'Hisar Academy', 'HISAR-002', 'Hisar Academy', 'UAMA-Hisar_Academy.jpg', 'Iskender Buyuksoylu', '+13109067454', 'hisaracademy@uama.us', '<div style="display: idne;">&nbsp;</div>\n\n<p>We was established to provide permanent solutions for the Muslims in idrth America with their religious needs, primarily by providing appropriate places to worship and providing an Islamic education for the youth.&nbsp;</p>\n\n<p>Starting point; In the light of the Sunnah and Quran, it is to raise and educate Muslims who benefit themselves, his family, his environment, his country and all of humanity. To provide an exceptional Islamic education in accordance with Ahli-Sunnah Wa&#39;l-Jamaah for every Muslim with or without access to education.&nbsp;</p>\n\n<p>We also carry out activities that will allow Muslims living in idrth America to perform their worship such as, Zakah-Fitrah-Charity, Sacrifice/Udhiyyah, Funeral/Janazah, Wedding, etc..</p>\n\n<p>We deliver&nbsp;the donations it collects from people with high awareness, to every needy person regardless of culture, race or ethnicity, by giving priority to education.&nbsp;</p>\n\n<p>We also keenly controls and monitors its operations on behalf of its doidrs by expecting all the sensitivities it has from all organizations and partnerships.</p>\n', 1, 1, '2020-10-25 20:26:06+00', '2021-07-05 14:19:38+00', NULL),
